import { StyledImg } from "./style"
import { BASE_URL } from "../Constants/BASE_URL"

export default function Home() {
    const cardsMap = cards.lenght > 0 && cards.map((card) => {
        return (
            <StyledImg
            src={`${BASE_URL}/${card.image}`}
            alt={card.name}
            key={card.name}
            />
        )
    })

    return (
        <div>
            <div>
                {cardsMap}
            </div>
        </div>
    )
}
